import React from 'react';
import Header from './Cabeçalho';
import MainMenu from './Menu-principal';
import ProdutoInfo from './ProdutoInfo';
import UserComments from './UserComments';
import ProductQuestions from './ProductQuestions';
import RelatedProducts from './RelatedProducts';
// import Jequiti from './jequiti'
import './App.css'

class EcommerceApp extends React.Component {
  render() {
    return (
      <div className="ecommerce-app">
        /* <Jequiti/> */
        <Header />
        <MainMenu />
        <main className="content">
          <ProdutoInfo />
          <section className="seller-info">
            <h3>Informações do Vendedor</h3>
            <p>Nome do vendedor</p>
            <p>Localização do vendedor</p>
          </section>
          <UserComments />
          <ProductQuestions />
          <RelatedProducts />
        </main>
        <footer className="footer">
          <p>Todos os direitos reservados &copy; 2023</p>
        </footer>
      </div>
    );
  }
}

export default EcommerceApp;
